            if size(b,1)~=size(x,1)
                b=repmat(b,size(x,1),1);
                TE=repmat(TE,size(x,1),1);
            end

            if size(x,1)~=1
                error('current implementation only supports evaluation of 1 kernel at a time')
            end
            D_FW=3;T2_FW=500;

