            % Adding p00 and enforcing that the p_{l-m} are linked to p_{lm} because
            % the ODF is real.
            % Evaluating the SH in Lebedev directions
            [phiLeb,thetaLeb,~]=cart2sph(lebx,leby,lebz);thetaLeb=pi/2-thetaLeb;
            %==========================================================================
            % Computing Spherical Harmonics
            l=0:2:Lmax;
            l_all=[];
            m_all=[];
            for ii=1:length(l)
                l_all=[l_all, l(ii)*ones(1,2*l(ii)+1)];
                m_all=[m_all -l(ii):l(ii)];
            end
            K_lm=sqrt((2*l_all+1)./(4*pi) .* factorial(l_all-abs(m_all))./factorial(l_all+abs(m_all)));
            extra_factor=ones(size(K_lm));
            extra_factor(m_all~=0)=sqrt(2);
            P_l_in_cos_theta=zeros(length(l_all),Nq);
            phi_term=zeros(length(l_all),Nq);
            id_which_pl=zeros(1,length(l_all));
            for ii=1:length(l_all)
                all_Pls=legendre(l_all(ii),cos(thetaLeb));
                P_l_in_cos_theta(ii,:)=all_Pls(abs(m_all(ii))+1,:);
                id_which_pl(ii)=abs(m_all(ii))+1;
                if m_all(ii)>0
                    phi_term(ii,:)=cos(m_all(ii)*phiLeb);
                elseif m_all(ii)==0
                    phi_term(ii,:)=1;
                elseif m_all(ii)<0
                    phi_term(ii,:)=sin(-m_all(ii)*phiLeb);
                end
            end
            % Only 1 plm
            % plm_x_Y_lm=diag([1/sqrt(4*pi);plm(:)]'.*extra_factor.*K_lm)*(phi_term.*P_l_in_cos_theta);
            % Pn_Quad_SH_ODF=sum(plm_x_Y_lm)'; % size is [Nqx1]

            %==========================================================================
            D_FW=3;T2_FW=500;
            M=length(f);

            Pn_Quad_SH_ALL_ODF=zeros(Nq,M);
            for ii=1:M
                plm_x_Y_lm=diag([1/sqrt(4*pi);plm_not_normalized(ii,:)']'.*extra_factor.*K_lm)*(phi_term.*P_l_in_cos_theta);
                Pn_Quad_SH_ALL_ODF(:,ii)=sum(plm_x_Y_lm)'; % size is [NqxM]
            end

            signal=zeros(M,Ndirs);
            Bij_ninj_all=zeros(Nq,Ndirs);
            for ii=1:Ndirs
                % psi_squared is B:(n x n) for all n's in n_quad.
                Bij_ninj_all(:,ii)=dot(n_quad_1x6,repmat(B(:,ii)',Nq,1),2);
            end
            b_matrix=repmat(b,Nq,1);
            TE_matrix=repmat(TE,Nq,1);
            LebW=lebw';
            parfor jj=1:M
            %     Current_Pn_Quad_SH=Pn_Quad_SH_ALL_ODF(:,jj);
                Current_Pn_Quad_SH=repmat(Pn_Quad_SH_ALL_ODF(:,jj),1,Ndirs);
                Quad_Kernel=f(jj)*exp(-b_matrix.*Da(jj).*Bij_ninj_all-TE_matrix/T2a(jj))+f_extra(jj)*exp(-b_matrix*Deperp(jj)-b_matrix.*(Depar(jj)-Deperp(jj)).*Bij_ninj_all-TE_matrix/T2e(jj))+(1-f(jj)-f_extra(jj))*exp(-b_matrix*D_FW-TE_matrix/T2_FW);
            %     S2=repmat(Current_Pn_Quad_SH,1,Ndirs).*Quad_Kernel;
                S2=Current_Pn_Quad_SH.*Quad_Kernel;
                signal(jj,:)=LebW*S2;% Here I perform the integral of the ODF and the signal
            end
            signal=signal';
        end
        % =================================================================
        function Moments_Extended = Compute_extended_moments(Moments,degree)
            % Moments_Extended = Compute_extended_moments(Moments,degree)
            %
            % This function computes the extended matrix of moments for polynomial
            % interpolation in multiple dimensions.
            %
            % Moments is [NxD] where N is the number of samples and D the dimension of
            % the problem (the number of different moments)
            %
            % e.g. in 1D this extended matrix equals the Vandermonde matrix
            % Moments_Extended = [1 X X^2 ... X^degree]
            %
            %
            % By: Santiago Coelho
            N=size(Moments,1);
            N_moments=size(Moments,2);
            % Preparing data points for polynomial fitting
            x_0=ones(N,1);
            if degree>=1
                x_1=Moments;
                X=[x_0 x_1];
            else
                X=x_0;
            end
            if degree>=2
                for current_degree=2:degree
                    combinations=nchoosek(1:(N_moments+current_degree-1),current_degree);
                    NtotalCombs=size(combinations,1);
                    flags=zeros(NtotalCombs,N_moments+current_degree-1);
                    sums=zeros(NtotalCombs,N_moments+current_degree-1);
                    which=zeros(NtotalCombs,current_degree);
                    for ii=1:NtotalCombs
                        flags(ii,combinations(ii,:))=1;
                        sums(ii,:)=cumsum(~flags(ii,:))+1;
                        which(ii,:)=sums(ii,combinations(ii,:));
                    end
                    Currentx=ones(N,NtotalCombs);
                    for ii=1:NtotalCombs
                        for jj=1:current_degree
                            current_id=which(ii,jj);
                            Currentx(:,ii)=Currentx(:,ii).*Moments(:,current_id);
                        end
                    end
                    X=[X Currentx];
                end
            end
            Moments_Extended=X;
        end
        % =================================================================
        function [Bset,B3x3xN] = ConstructAxiallySymmetricBset(b,beta,dirs)
            % [Bset,B3x3xN] = ConstructAxiallySymmetricBset(b,beta,dirs)
            %
            % This function computes a set of axially symmetric
            % b-tensors from their b-value, b-tensor shape, and b-vectors.
            %
            % By: Santiago Coelho
            Ndwi=length(b);
            Bset=zeros(6,Ndwi);
            B3x3xN=zeros(3,3,Ndwi);
            if size(dirs,1)~=3
                dirs=dirs';
            end
            if size(dirs,2)~=Ndwi || length(beta)~=Ndwi
                error('dirs should have the same number of columns as elements in b and beta')
            end

            for ii=1:Ndwi
                B_aux= beta(ii)*dirs(:,ii)*dirs(:,ii)' + 1/3*(1-beta(ii))* eye(3);
                B_aux=B_aux/trace(B_aux);
                if any(isnan(B_aux(:)))
                    B_aux=zeros(3);
                else
                    B_aux=b(ii)*B_aux;
                end
                Bset(:,ii)=[B_aux(1,1),B_aux(2,2),B_aux(3,3),B_aux(1,2),B_aux(1,3),B_aux(2,3)]';
                B3x3xN(:,:,ii)=B_aux;
            end
        end
        % =================================================================
        function [Slm,Sl,ids_clusters_all,table_4D_sorted] = Fit2D4D_LLS_RealSphHarm_wSorting_norm_varL(DWI,mask,bval,bvec,beta,TE,Lmax)
            % [Slm,Sl,ids_clusters_all,table_4D_sorted] = Fit2D4D_LLS_RealSphHarm_wSorting_norm_varL(DWI,mask,bval,bvec,beta,TE,Lmax)
            % 
            % This function performs the linear fit of Slm on each shell using real spherical
            % harmonics as defined in https://cs.dartmouth.edu/~wjarosz/publications/dissertation/appendixB.pdf
            %
            % The Condon-Shortley phase is used in this definition
            %
            % Inputs: 
            % DWI is assumed to be either 2D [Nmeasurements x Nvoxels] or 4D [Nx x Ny x Nz x Nmeasurements]
            % bval, bvec, beta, TE indicate the acquisition
            % If beta or TE are constant throughout the acquisition, these can be left
            % empty
            % Lmax is the maximum order considered for the fitting of Slms
            % (this can be a different order in all clusters but input order is the same as given by Group_dwi_in_shells_b_beta_TE)
            %
            % Outputs: Slm is size [N_SH_coeffs x Nvoxels x Nclusters]
            %          Sl is size [Lmax/2+1 x Nvoxels x Nclusters]
            %          table_4D_sorted has a size [4 x Nshells], 
            %          The order of the Rotational Invariants is given by Group_dwi_in_shells_b_beta_TE
            %          and it is provided in table_4D_sorted
            %
            % By: Santiago Coelho
            sz_DWI=size(DWI);
            if length(sz_DWI)==4
                flag_4D=1;
            elseif length(sz_DWI)==2
                flag_4D=0;
            else
                error('DWI must be a 2D or 4D array')
            end

            if flag_4D
                if isempty(mask)
                    mask=true(sz_DWI(1:3));
                end
                dwi_2D = SMI.vectorize(DWI,mask);
            else
                dwi_2D = DWI;
            end

            if ~isvector(bval)
                error('bval should be a vector')
            else
                bval=bval(:)';
            end
            if isempty(beta)
                beta=zeros(size(bval))+1;
            else
                beta=beta(:)';
            end
            if isempty(TE)
                TE=zeros(size(bval))+100;
            else
                TE=TE(:)';
            end

            Nvoxels=size(dwi_2D,2);
            Nmeas=size(dwi_2D,1);

            if length(bval)~=Nmeas
                error('bval should be a vector with the same length as the number of DWI')
            end

            [bb,~,~] = SMI.Group_dwi_in_shells_b_beta_TE(bval,beta,TE,[]);

            Nshells=size(bb,2);
            if isscalar(Lmax)
                Lmax=Lmax*ones(1,Nshells);
            end

            % Hard-wiring Lmax=0 for b0s and STE data
            Lmax(bb(1,:)<0.025)=0;
            Lmax(abs(bb(2,:))<0.025)=0;

            if max(bval)<500
                flag_microstructure_units=1;
                % make all b0s LTE
                beta(bval<0.05)=1;
            else
                flag_microstructure_units=0;
                % make all b0s LTE
                beta(bval<50)=1;
            end

            N_SH_coeffs=1+Lmax.*(Lmax+3)/2;
            if size(bvec,1)==Nmeas
                dirs=bvec;
            else
                dirs=bvec';
            end
            l=0:2:max(Lmax);
            l_all=[];
            m_all=[];
            for ii=1:length(l)
                l_all=[l_all, l(ii)*ones(1,2*l(ii)+1)];
                m_all=[m_all -l(ii):l(ii)];
            end
            N_l_all=sqrt((2*l_all+1)*(4*pi));
            N_l_unique=sqrt((2*l+1)*(4*pi));
            
            CSphase=1;
            Y_LM_matrix = SMI.get_even_SH_local(dirs,max(Lmax),CSphase);

            S_l_clusters_all=zeros(max(Lmax)/2+1,Nvoxels,Nshells);
            S_lm_clusters_all=zeros(max(N_SH_coeffs),Nvoxels,Nshells);
            id_measurements=1:Nmeas;
            ids_current_cluster_all=[];
            for ii=1:Nshells
                ids_current_cluster=id_measurements((abs(bb(1,ii)-bval)<1e-3)&(abs(bb(2,ii)-beta)<1e-2)&(abs(bb(4,ii)-TE)<1e-1));
                if abs(length(ids_current_cluster)-bb(3,ii))>0.1
                    error('count of elements in current cluster failed, check bb and B inputs')
                end
                if (abs(bb(2,ii))>0.045)&&(bb(1,ii)>0.05)
                    ids_current_lm=1:N_SH_coeffs(ii);
                    S_lm_current_cluster=Y_LM_matrix(ids_current_cluster,ids_current_lm)\dwi_2D(ids_current_cluster,:);
                    S_l_current_cluster=zeros(Lmax(ii)/2+1,Nvoxels);
                    S_l_current_cluster(1,:)=abs(S_lm_current_cluster(1,:));
                    for jj=2:2:Lmax(ii)
                        ids_currentl_m=(1/2*(jj+1).*(jj+2)-jj)+((-jj):(jj));
                        S_l_current_cluster(jj/2+1,:)=sqrt(sum(S_lm_current_cluster(ids_currentl_m,:).^2,1));
                    end
                else
                    S_lm_current_cluster=zeros(N_SH_coeffs(ii),Nvoxels);
                    S_l_current_cluster=zeros(Lmax(ii)/2+1,Nvoxels);
                    S_lm_current_cluster(1,:)=sqrt(4*pi)*mean(dwi_2D(ids_current_cluster,:));
                    S_l_current_cluster(1,:)=abs(S_lm_current_cluster(1,:));
                end
                S_lm_clusters_all(1:N_SH_coeffs(ii),:,ii)=S_lm_current_cluster./repmat(N_l_all(1:N_SH_coeffs(ii))',1,Nvoxels);
                S_l_clusters_all(1:(Lmax(ii)/2+1),:,ii)=S_l_current_cluster./repmat(N_l_unique(1:(Lmax(ii)/2+1))',1,Nvoxels);
                ids_current_cluster_all=[ids_current_cluster_all,[ids_current_cluster*0+ii;ids_current_cluster]];
            end  
            Slm=S_lm_clusters_all;
            Sl=S_l_clusters_all;
            if nargout>=3
                ids_clusters_all=ids_current_cluster_all;
            end
            if nargout==4
                table_4D_sorted=bb;
            end

            if flag_4D
                % reshape Sl and Slm
                Sl=zeros(sz_DWI(1),sz_DWI(2),sz_DWI(3),max(Lmax)/2+1,Nshells);
                Slm=zeros(sz_DWI(1),sz_DWI(2),sz_DWI(3),max(N_SH_coeffs),Nshells);
                for ii=1:Nshells
                    Sl(:,:,:,:,ii)=SMI.vectorize(S_l_clusters_all(:,:,ii),mask);
                    Slm(:,:,:,:,ii)=SMI.vectorize(S_lm_clusters_all(:,:,ii),mask);
                end
            end
        end
        % =================================================================
        function Ylm_n = get_even_SH_local(dirs,Lmax,CS_phase)
            % Ylm_n = get_even_SH(dirs,Lmax,CS_phase)
            %
            % if CS_phase=1, then the definition uses the Condon-Shortley phase factor
            % of (-1)^m. Default is CS_phase=0 (so this factor is ommited)
            %
            % By: Santiago Coelho
            if size(dirs,2)~=3
                dirs=dirs';
            end
            Nmeas=size(dirs,1);
            [PHI,THETA,~]=cart2sph(dirs(:,1),dirs(:,2),dirs(:,3)); THETA=pi/2-THETA;
            l=0:2:Lmax;
            l_all=[];
            m_all=[];
            for ii=1:length(l)
                l_all=[l_all, l(ii)*ones(1,2*l(ii)+1)];
                m_all=[m_all -l(ii):l(ii)];
            end
            K_lm=sqrt((2*l_all+1)./(4*pi) .* factorial(l_all-abs(m_all))./factorial(l_all+abs(m_all)));
            if nargin==2 || isempty(CS_phase) || ~exist('CS_phase','var') || ~CS_phase
                extra_factor=ones(size(K_lm));
                extra_factor(m_all~=0)=sqrt(2);
            else
                extra_factor=ones(size(K_lm));
                extra_factor(m_all~=0)=sqrt(2);
                extra_factor=extra_factor.*(-1).^(m_all);
            end
            P_l_in_cos_theta=zeros(length(l_all),Nmeas);
            phi_term=zeros(length(l_all),Nmeas);
            id_which_pl=zeros(1,length(l_all));
            for ii=1:length(l_all)
                all_Pls=legendre(l_all(ii),cos(THETA));
                P_l_in_cos_theta(ii,:)=all_Pls(abs(m_all(ii))+1,:);
                id_which_pl(ii)=abs(m_all(ii))+1;
                if m_all(ii)>0
                    phi_term(ii,:)=cos(m_all(ii)*PHI);
                elseif m_all(ii)==0
                    phi_term(ii,:)=1;
                elseif m_all(ii)<0
                    phi_term(ii,:)=sin(-m_all(ii)*PHI);
                end
            end
            Y_lm=repmat(extra_factor',1,Nmeas).*repmat(K_lm',1,Nmeas).*phi_term.*P_l_in_cos_theta;
            Ylm_n=Y_lm';
        end
        % =================================================================
        function [table_4D,sorted_ids,shell_ids] = Group_dwi_in_shells_b_beta_TE(bval,beta,TE,MergeDistance)
            % [table_4D,sorted_ids,shell_ids] = Group_dwi_in_shells_b_beta_TE(bval,beta,TE,MergeDistance)
            %
            % table_4D contains [bval;beta;Ndirs;TE] for each shell (N shells -> N columns)
            %                   Shells are in ascending b-value, beta, TE
            % shell_ids contains [shell numberof each input in the old order
            % sorted_ids contains original input order for the ordered shells
            %
            % If the input protocol has equal TE on all DWI, or equal beta on all DWI,
            % then this function returns the shells ordered in increasing b-value.
            %
            % By: Santiago Coelho
            if ~isvector(bval)
                error('bval should be a vector')
            else
                bval=bval(:)';
            end
            if isempty(beta)
                beta=zeros(size(bval))+1;
            else
                beta=beta(:)';
            end
            if isempty(TE)
                TE=zeros(size(bval))+100;
            else
                TE=TE(:)';
            end

            if max(bval)<500
                flag_microstructure_units=1;
                % make all b0s LTE
                beta(bval<0.05)=1;
            else
                flag_microstructure_units=0;
                % make all b0s LTE
                beta(bval<50)=1;
            end

            if isempty(MergeDistance)
                if flag_microstructure_units
                    MergeDistance=0.05;
                else
                    MergeDistance=50;
                end
            end
            Clusters=[bval;beta;TE]';
            id_cluster=clusterdata(Clusters,'Criterion','distance','Cutoff',MergeDistance);
            sorted_ids_intermediate=[];
            shell_ids_intermediate=[];
            id_original_SortParam=1:length(id_cluster);
            table_4D=zeros(4,length(unique(id_cluster)));
            for ii=1:length(unique(id_cluster))
                table_4D(:,ii)=[mean(bval(id_cluster==ii));mean(beta(id_cluster==ii));sum(id_cluster==ii);mean(TE(id_cluster==ii))];
                sorted_ids_intermediate=[sorted_ids_intermediate id_original_SortParam(id_cluster==ii)];
                shell_ids_intermediate=[shell_ids_intermediate ii*ones(1,sum(id_cluster==ii))];
            end

            % Now I order them in ascending b-value, beta, TE
            table_aux=table_4D;
            table_aux(2,:)=round(table_aux(2,:),2);
            if flag_microstructure_units
               table_aux(1,:)=round(table_aux(1,:),2);
            else
               table_aux(1,:)=round(table_aux(1,:),-1);
            end
            [table_aux_sorted,index_sorted2]=sortrows(table_aux',[1 2 4]);
            table_aux_sorted=table_aux_sorted';
            sorted_ids=[];
            shell_ids=sorted_ids_intermediate*0;
            for ii=1:size(table_aux,2)
                aux=sorted_ids_intermediate(shell_ids_intermediate==index_sorted2(ii));
                sorted_ids=[sorted_ids aux];
                shell_ids(aux)=ii;
            end
            table_4D=table_aux_sorted;
        end
        % =================================================================
        function [f,Da,Depar,Deperp,f_FW,T2a,T2e,p2,plm] = Get_uniformly_distributed_SM_prior(M,lb,ub,Lmax,flag_Depar_Deperp)
            % [f,Da,Depar,Deperp,f_FW,T2a,T2e,p2,plm] = Get_uniformly_distributed_SM_prior(M,lb,ub,Lmax,flag_Depar_Deperp)
            %
            % lower and upper bounds on {'$f$','$D_a$','$D_e^{||}$','$D_e^{\perp}$','$f_{FW}$','$T_a^2$','$T_e^2$','$p_2$'};
            if nargin<=4||isempty(flag_Depar_Deperp)
                flag_Depar_Deperp=0;
            end
            % Water fractions
            f=rand(5*M,1)*(ub(1)-lb(1))+lb(1);
            f_FW=rand(5*M,1)*(ub(5)-lb(5))+lb(5);
            keep=1>(f+f_FW);
            f=f(keep);f=f(1:M);
            f_FW=f_FW(keep);f_FW=f_FW(1:M);
            f_extra=1-f-f_FW;
            % Diffusivities
            Da = rand(M,1)*(ub(2)-lb(2))+lb(2);
            if flag_Depar_Deperp
                Depar = rand(5*M,1)*(ub(3)-lb(3))+lb(3);
                Deperp = rand(5*M,1)*(ub(4)-lb(4))+lb(4);
                keep=Depar>Deperp;
                Depar=Depar(keep);Depar=Depar(1:M);
                Deperp=Deperp(keep);Deperp=Deperp(1:M);
            else
                Depar = rand(M,1)*(ub(3)-lb(3))+lb(3);
                Deperp = rand(M,1)*(ub(4)-lb(4))+lb(4);
            end
            % T2 values
            T2a=rand(M,1)*(ub(6)-lb(6))+lb(6);
            T2e=rand(M,1)*(ub(7)-lb(7))+lb(7);
            % p2m
            if (nargin<=3)||isempty(Lmax)||(Lmax==2)
                p2 = rand(M,1)*(ub(8)-lb(8))+lb(8);
                norm_p2l=@(p2l)sqrt(sum(p2l.^2));
                DIM=5;
                x=randn(DIM,M);
                initial_norm=norm_p2l(x);
                x_normalised=x./repmat(initial_norm,DIM,1);
                x_newnorm=x_normalised.*repmat(p2',DIM,1);
                p2m=x_newnorm;
                plm=p2m';
            else
                p2=rand(1,M)*(ub(8)-lb(8))+lb(8);
                p4=rand(1,M).*p2*0.9; 
                p6=rand(1,M).*p4*0.9; 
                p8=rand(1,M).*p6*0.9;    

                norm_p2l=@(p2l)sqrt(sum(p2l.^2));
                norm_p4l=@(p4l)sqrt(sum(p4l.^2));
                norm_p6l=@(p6l)sqrt(sum(p6l.^2));
                norm_p8l=@(p8l)sqrt(sum(p8l.^2));
                if Lmax>=2
                    DIM=5;
                    x=randn(DIM,M);
                    initial_norm=norm_p2l(x);
                    x_normalised=x./repmat(initial_norm,DIM,1);
                    x_newnorm=x_normalised.*repmat(p2,DIM,1);
                    p2m=x_newnorm;
                    plm=p2m';
                end
                if Lmax>=4
                    DIM=9;
                    x=randn(DIM,M);
                    initial_norm=norm_p4l(x);
                    x_normalised=x./repmat(initial_norm,DIM,1);
                    x_newnorm=x_normalised.*repmat(p4,DIM,1);
                    p4m=x_newnorm;
                    plm=[p2m;p4m]';
                end
                if Lmax>=6
                    DIM=13;
                    x=randn(DIM,M);
                    initial_norm=norm_p6l(x);
                    x_normalised=x./repmat(initial_norm,DIM,1);
                    x_newnorm=x_normalised.*repmat(p6,DIM,1);
                    p6m=x_newnorm;
                    plm=[p2m;p4m;p6m]';
                end
                if Lmax>=8
                    DIM=17;
                    x=randn(DIM,M);
                    initial_norm=norm_p8l(x);
                    x_normalised=x./repmat(initial_norm,DIM,1);
                    x_newnorm=x_normalised.*repmat(p8,DIM,1);
                    p8m=x_newnorm;
                    plm=[p2m;p4m;p6m;p8m]';
                end
                p2=p2';
            end
        end
        % =================================================================
        function Lmax = GetDefaultLmax(b,beta,TE)
            % Lmax = GetDefaultLmax(b,beta,TE)
            %
            % This function returns a 'good' Lmax based on the b-value of
            % the shell
            [table_4D,~,~] = SMI.Group_dwi_in_shells_b_beta_TE(b,beta,TE,[]);
            b=table_4D(1,:);
            beta=table_4D(2,:);
            Lmax=zeros(1,size(table_4D,2));
            if max(b)<100
                b_micro_units=b;
            else
                b_micro_units=b/1000;
            end
            for ii=1:length(b_micro_units)
                if (abs(beta(ii))<0.1)||(b_micro_units(ii)<0.1)
                    Lmax(ii)=0;
                else
                    if b_micro_units(ii)<1.2
                        Lmax(ii)=2;
                    elseif b_micro_units(ii)<2.5
                        Lmax(ii)=4;
                    elseif b_micro_units(ii)<6.5
                        Lmax(ii)=6;
                    else
                        Lmax(ii)=8;
                    end
                end
            end
        end
        % =================================================================
        function plotSlices(ARRAY_4D, slice,clims,names,Nrows,positions,nanTransparent,colorbar_flag)
            %
            sz=size(ARRAY_4D);
            if length(sz)==4
                Nplots=sz(4);
            elseif length(sz)==3
                Nplots=sz(3);
            end

            if ~exist('positions', 'var') || isempty(positions)
                positions=1:Nplots;
            end
            if ~exist('nanTransparent', 'var') || isempty(nanTransparent)
                nanTransparent=0;
            end
            if ~exist('colorbar_flag', 'var') || isempty(colorbar_flag)
                colorbar_flag=1;
            end

            if isvector(clims)
                clims=repmat(clims,Nplots,1);
            end

            for ii=1:Nplots
                subplot(Nrows,ceil(Nplots/Nrows),positions(ii))
                if ~nanTransparent
                    if length(sz)==4
                        imagesc(ARRAY_4D(:,:,slice,ii),clims(ii,:))
                    elseif length(sz)==3
                        imagesc(ARRAY_4D(:,:,ii),clims(ii,:))
                    end
                else
                    if length(sz)==4
                        h=pcolor(ARRAY_4D(:,:,slice,ii)); caxis(clims(ii,:)),set(h, 'EdgeColor', 'none');
                    elseif length(sz)==3
                        h=pcolor(ARRAY_4D(:,:,ii)); caxis(clims(ii,:)),set(h, 'EdgeColor', 'none');
                    end
                end

                if isempty(names)
                    title(['case ',num2str(ii)],'interpreter','latex')
                else
                    title(names{ii},'interpreter','latex')
                end
                set(gca,'FontSize',30), axis off, grid off

                if colorbar_flag
                cb=colorbar('south'); 
            %     cb_pos =  cb.Position;cb_pos(3)=0.03;
            %     set(cb,'position',cb_pos)
                cb.Ticks=clims(ii,:);    
                end
            end
        end        
        % =================================================================
        function [s, mask] = vectorize(S, mask)
            if nargin == 1
               mask = ~isnan(S(:,:,:,1));
            end
            if ismatrix(S)
                n = size(S, 1);
                [x, y, z] = size(mask);
                s = NaN([x, y, z, n], 'like', S);
                for i = 1:n
                    tmp = NaN(x, y, z, 'like', S);
                    tmp(mask(:)) = S(i, :);
                    s(:,:,:,i) = tmp;
                end
            else
                for i = 1:size(S, 4)
                   Si = S(:,:,:,i);
                   s(i, :) = Si(mask(:));
                end
            end
        end
        % =================================================================
    end
end

